import React from 'react';
import { Card, Tab, Tabs } from 'react-bootstrap';
//import SSO from "./SSO";
import LoginForm from './loginform';
import { useSelector } from 'react-redux';

function LoginTabs() {
  const site = useSelector((state) => state.site);
  const user = useSelector((state) => state.user);

  if (!site.authentication) {
    return 'To be implemented: select a site';
  }

  return (
    <Tabs id="login-tabs" animation={false}>
      {site.authentication.sso.enabled !== 'false' && (
        <Tab eventKey="sso" title="SSO">
          <Card className="tab-panel-fix">SSo should be displayed here</Card>
        </Tab>
      )}
    </Tabs>
  );
}

export default LoginTabs;
